import React from "react";

function ConditionForm(props)
{
    return(
        <div>
            <select 
                formIndex={props.formIndex}
                name="conditionType"
                value={props.conditionType}
                onChange={props.onChange}
            >
                <option value="">-- select something --</option>
                <option value="required">required</option>
                <option value="optional">optional</option>
            </select>
            &nbsp; &nbsp; 
            <input id="count" style={{width: 40}} max="99" min="1" type="number" />
            &nbsp; &nbsp;&nbsp;
            <select id="achievementDropdown">
                <option>leadership training</option>
                <option>drivers licence</option>
                <option>some other training</option>
                <option>more stuff</option>
            </select>
            &nbsp;&nbsp;&nbsp;
            <button>remove</button>
        </div>
    )
}

export default ConditionForm;
